const Solutions = ({ location, id }: any) => {
  
  console.log('location is. in analytics.tsx: ', location)

  return (
  <LayoutTmplt 
    location={location} 
    // customMenu={solutionsSubMenu} 
    // siderMenu={siderMenu} 
    bgColor="#E6F7FF" 
    id={id}
  >
    <Content className="soln-grid-container">
      {/* <Row>
        <BrandCarousel />
      </Row> */}
      <Row className="soln-title-row">
        <h1 className="soln-title">Uncover Actionable Insights</h1>
      </Row>
      <Row className="soln-card-title-row">
        <Col id="ct1" className="soln-card-title">
          <h2>Assess</h2>
        </Col>
        <Col id="ct2" className="soln-card-title">
          <h2>Insights</h2>
        </Col>
      </Row>
      <Row className="soln-card-row">
        <Card 
          id="c1" 
          className="soln-card" 
          hoverable={true}
        >
          <List 
            dataSource={[
              ['bar-chart', 'Weekly Activity'], 
              ['dashboard', 'CRO Performance'],
              ['rise', 'Site Performance'],
              ['radar-chart', 'Study Health'],
              ['sliders', 'Cross-Study Evaluation'],
            ]}
            size="large"
            renderItem={(item: string[], idx: number) => 
              <List.Item className="soln-card-item">
                <div id={'c-li' + idx}>
                  <Icon
                    className="soln-card-item-icon"
                    type={item[0]}
                  />
                  {item[1]}
                </div>
            </List.Item>}
          />
        </Card>
        <Card 
          id="c2" 
          className="soln-card" 
          hoverable={true}
        >
          <List
            dataSource={[
              ['hourglass', 'Real-Time Optimization'],
              ['warning', 'Ecosystem Bottlenecks'],
              ['fall', 'Potential Painpoints'],
              ['compass', 'Decision Support'],
              ['global', 'Strategic Support'],
            ]}
            size="large"
            renderItem={(item: string[], idx: number) =>
              <List.Item className="soln-card-item">
                <div id={'c-li' + idx}>
                  <Icon
                    className="soln-card-item-icon"
                    type={item[0]}
                  />
                  {item[1]}
                </div>
              </List.Item>}
          />
        </Card>
      </Row>
      <Row className="soln-fig-container">
        <SolutionFunnel />
      </Row>
    </Content>
  </LayoutTmplt>
)}

export default Solutions
